import FastReservationCarInfo from "./FastReservationCarInfo";


class FastCarReservation extends Component {

    render() {

        return (
            <div>
                <div className="container">
                    <h3 className="red-text lighten-1">Brza rezervacija vozila</h3>

                    <FastReservationCarInfo />
                    <FastReservationCarInfo />
                    <FastReservationCarInfo />
                    <FastReservationCarInfo />
                    <FastReservationCarInfo />


                </div>
            </div>
        );
    }

}

export default FastCarReservation;
